import React, {Component} from 'react';
import '../assets/PantallaLogin.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class LaminadoDatos extends Component
{
    render()
    {
        return(
            <div className = "body">
                <div className="otroBody">
                    <div className="container modalLaminado">

                        <input id="" className="customInputs" type="number" step="any"></input>
                        <a href="/opciones"><button className="customButtons">Forjado</button></a>

                    </div>
                </div>
            </div>
        );
    }
}
export default LaminadoDatos;
